void MasterChannelPanel::timerCallback() {

    if (mode == MAGNITUDE) {
        vuSliderLeft->setValue(mcc->getMagnitude(0) * leftVolumeSlider->getValue());
        vuSliderRight->setValue(mcc->getMagnitude(1) * rightVolumeSlider->getValue());
    }
    else {
        vuSliderLeft->setValue(mcc->getRms(0)*leftVolumeSlider->getValue());
        vuSliderRight->setValue(mcc->getRms(1)*rightVolumeSlider->getValue());
    }

}

